import React, { Component } from 'react';
import './navbar.css';

class Navbar extends Component {
	render() {
		return (
			<div className='navbar'>
				<div className='navbar-title'>
					Cody Swain
				</div>
				<div className='navbar-items'>
					<ul>
						<li>Home</li>
						<li>Resume</li>
						<li>About</li>
					</ul>
				</div>
			</div>
		)
	}
}

export default Navbar;
